import Add from './add';
import Password from './password';

import './body.css';
import './add.css';

class Pass extends Component {
    state = {
        passWrong: true
    }

    callBack = (passWrong) => {

    }

    render() {
        if (passWrong) {
            return (
                <div>
                <div className="main">
                    <h1 className="title">ADD</h1>
                </div>


                <Password/>
                </div>
            );
        }
        else {
            return (
                <div>
                <div className="main">
                    <h1 className="title">ADD</h1>
                </div>

                <Add/>
                </div>
            );
        }
    }

}

export default Pass;
